// HomeScreen.js
import React from 'react';
import { Link } from 'react-router-dom';

const HomeScreen = () => {
    return (
        <div>
            <h1>Welcome to the Activities Platform</h1>
            <Link to="/manage-activity">
                <button>Create/Manage Activity</button>
            </Link>
        </div>
    );
};

export default HomeScreen;
